import React, { useEffect, useState } from 'react';

function Market() {
    const [items, setItems] = useState([]);
    const [filters, setFilters] = useState({ category: '', element: '', sortBy: 'endTime', sortOrder: 'asc', timeLeft: '' });

    useEffect(() => {
        const fetchItems = async () => {
            const queryString = new URLSearchParams(filters).toString();
            const response = await fetch(`http://localhost:8080/api/market?${queryString}`);
            const data = await response.json();
            setItems(data);
        };
        fetchItems();
    }, [filters]);

    return (
        <div className="w-full h-full bg-maincolor1 p-5 rounded-xl flex flex-col">
                <div className="flex justify-between items-center mb-4">
                    </div>
                    </div>
                
    );
}

export default Market;
